    [],nt"revision_timestamp": "2016-07-27T22:46:03.181634",nt"name": "fort-peck-game-range-refuge-narrative-report-may-june-july-august-1953",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Fort Peck NWR
    and the easement refuges outlines Refuge accomplishments from May through August
    of 1953. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, mammals, raptors, and fish- is also
    covered. The Refuge development and maintenance section discusses physical developments,
    plantings, and wildfires. Resource management is outlined; topics include grazing.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, and fishing. Items of interest, N-R forms, and photographs
    are attached.",nt"license_title": "License Not Specified",nt"extras":
